import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-victimcalc',
  templateUrl: './victimcalc.component.html',
  styleUrls: ['./victimcalc.component.css']
})

export class VictimcalcComponent implements OnInit {
  constructor(private http: HttpClient) {}

  calc() {
    const body = {
      "ageAtDeathA": 10,
      "yearOfDeathA": 12,
      "ageAtDeathB": 13,
      "yearOfDeathB": 17
    };
    this.http.post<any>("http://localhost:8087/api/v1/victim/average", body)
      .subscribe(
        (response) => {
          // Handle successful response
          console.log('Response:', response);
        },
        (error) => {
          // Handle error
          console.error('Error:', error);
        }
      );
  }

  ngOnInit(): void {

  }

}
<div class="container">
    <div class="mt-5">
        <div class="card">
            <div class="card-header">
              Witched Victim (calc)
            </div>
            <div class="row">
                <div class="col-md-6">
                    <div class="card-body">
                        <div class="form-group">
                          <label for="ageAtDeathA">ageAtDeathA</label>
                          <input type="number" class="form-control" id="ageAtDeathA" [(ngModel)]="ageAtDeathA">
                        </div>
                    </div>
                </div>
                <div class="col-md-6">
                    <div class="card-body">
                        <div class="form-group">
                          <label for="yearOfDeathA">yearOfDeathA</label>
                          <input type="number" class="form-control" id="yearOfDeathA" [(ngModel)]="yearOfDeathA">
                        </div>
                    </div>
                </div>
                <div class="col-md-6">
                    <div class="card-body">
                        <div class="form-group">
                          <label for="ageAtDeathB">ageAtDeathB</label>
                          <input type="number" class="form-control" id="ageAtDeathB" [(ngModel)]="ageAtDeathB">
                        </div>
                    </div>
                </div>
                <div class="col-md-6">
                    <div class="card-body">
                        <div class="form-group">
                          <label for="yearOfDeathB">yearOfDeathB</label>
                          <input type="number" class="form-control" id="yearOfDeathB" [(ngModel)]="yearOfDeathB">
                        </div>
                    </div>
                </div>
                <div class="col-md-12">
                    <div class="btn btn-primary mt-3" (click)="calc()">Calculate</div>
                </div>
            </div>
        </div>
    </div>
</div>
